import CelebretiesBox from "./CelebretiesBox";
import CelebData from "../celebData";
import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

function MiddlePage(props) {
  if (props.sort === "sort-by-age") {
    CelebData = CelebData.map();
  }

  let something = (
    <div className="bg-dark">
      <Container className="bg-dark">
        {CelebData.map((myCeleb, index) => {
          console.log(!index % 3);
          if (index % 3 === 0) {
            return (
              <Row key={index}>
                <Col>
                  <CelebretiesBox myCelebData={myCeleb} key={index} />
                </Col>
                <Col>
                  <CelebretiesBox
                    myCelebData={CelebData[index + 1]}
                    key={index}
                  />
                </Col>
                <Col>
                  <CelebretiesBox
                    myCelebData={CelebData[index + 2]}
                    key={index + 2}
                  />
                </Col>
              </Row>
            );
          }
          return null;
        })}
      </Container>
    </div>
  );

  return something;
}

export default MiddlePage;
